import React from 'react';
import { ActiveBtn } from './GlobalStyles'

const LoginBox = () => {

    const initialState = {
        user: {
            nick: 'ejonghwan'
        }
    }

    return (
        <div>
            {initialState.user.nick}
        </div>
    );
};

export default LoginBox;
